import { Link } from "react-router-dom"
import "./Menu.css";

export const Menu=()=>{
  return(
    <>
    <div className="menuContainer">
      <Link to="/createSurvey">
        <button>Create Survey</button>
      </Link>
      <Link to="/takeSurvey">
        <button>Take Survey</button>
      </Link>
    </div>

    <br/>

    </>
  )
}
